import React, { useEffect, useMemo, useState } from 'react';
import './css/Rankings.css';

const FORMATS = ['TEST', 'ODI', 'T20I'];

function pickEntry(data, gender, type) {
  return (data || []).find(
    (x) =>
      String(x?.resource).toLowerCase() === 'rankings' &&
      String(x?.gender).toLowerCase() === String(gender).toLowerCase() &&
      String(x?.type).toUpperCase() === String(type).toUpperCase()
  );
}
function normaliseTeams(entry) {
  return (entry?.team || [])
    .map((t) => ({
      id: t?.id ?? t?.team_id ?? Math.random(),
      name: t?.name || '',
      code: t?.code || '',
      img: t?.image_path || '',
      position: t?.ranking?.position ?? t?.position ?? null,
      matches: t?.ranking?.matches ?? null,
      points: t?.ranking?.points ?? null,
      rating: t?.ranking?.rating ?? null,
    }))
    .filter((t) => t.name && t.position != null)
    .sort((a, b) => a.position - b.position)
    .slice(0, 5); // ⬅️ Top 5 here
}

export default function Rankings() {
  const [data, setData] = useState([]);
  const [gender, setGender] = useState('men'); // toggle men/women
  const [loading, setLoading] = useState(true);
  const [err, setErr] = useState('');

  useEffect(() => {
    let mounted = true;
    (async () => {
      try {
        setLoading(true);
        setErr('');
        const r = await fetch('/api/team-rankings');
        const j = await r.json();
        if (mounted) setData(Array.isArray(j?.data) ? j.data : Array.isArray(j) ? j : []);
      } catch (e) {
        if (mounted) setErr(String(e));
      } finally {
        if (mounted) setLoading(false);
      }
    })();
    return () => { mounted = false; };
  }, []);

  const blocks = useMemo(() => {
    return FORMATS.map((fmt) => {
      const entry = pickEntry(data, gender, fmt);
      const teams = normaliseTeams(entry);
      return { fmt, teams, updated_at: entry?.updated_at || null };
    });
  }, [data, gender]);

  return (
    <div className="rk5-wrap">
      <div className="rk5-head">
        <div className="rk5-tabs">
          {['men','women'].map((g) => (
            <button
              key={g}
              className={`rk5-tab ${gender === g ? 'is-active' : ''}`}
              onClick={() => setGender(g)}
            >
              {g === 'men' ? 'Men' : 'Women'}
            </button>
          ))}
        </div>
      </div>

      {loading && <div className="rk5-state">Loading…</div>}
      {!loading && err && <div className="rk5-state rk5-error">{err}</div>}

      {!loading && !err && (
        <div className="rk5-grid">
          {blocks.map(({ fmt, teams, updated_at }) => (
            <div key={fmt} className="rk5-card">
              <div className="rk5-card-head">
                <span className="rk5-chip">{fmt}</span>
                <span className="rk5-sub">Top 5</span>
              </div>
              {teams.length === 0 ? (
                <div className="rk5-empty">No data</div>
              ) : (
                <div className="rk5-list">
                  {teams.map((t) => (
                    <div key={t.id} className="rk5-row">
                      <div className="rk5-pos">{t.position}</div>
                      <div className="rk5-team">
                        {t.img ? <img src={t.img} alt={t.name} /> : <div className="rk5-crest" />}
                        <div className="rk5-name">{t.name}</div>
                        {t.code && <div className="rk5-code">({t.code})</div>}
                      </div>
                      <div className="rk5-rating">{t.rating ?? '-'}</div>
                    </div>
                  ))}
                </div>
              )}
              <div className="rk5-foot">
                {updated_at ? `Updated: ${new Date(updated_at).toLocaleDateString()}` : 'Updated: —'}
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}
